import React from 'react'
import {Component} from 'react'

export default class Article extends Component{
    render(){
        return(
            <div className="articleBox">
  <div className="row no-gutters">
      <img className="articleImg" src={props.articleImg} alt="img not found"></img>
    </div>
        <div className="articleDate font5">
          {props.articleDate}
        </div>
    <div className="font7 requiredTime">
      {props.readTime}
    </div>
    <div className="articleTitle font7">{this.props.articleTitle}</div>
    <div className='readArticle'>Read </div>
    </div>
        )
    }
}
